import React, { useState } from 'react';
import logo from '../assets/img/logo.png';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="bg-white flex justify-between items-center px-8 h-10 shadow-md relative">
      {/* Logo Section */}
      <div>
        <img src={logo} alt="Logo" className="h-12 w-auto" />
      </div>

      {/* Hamburger Menu Icon for Mobile */}
      <div className="md:hidden">
        <button onClick={toggleMenu} className="text-3xl">
          <svg
            className="w-6 h-6"
            fill="none"
            stroke="currentColor"
            viewBox="0 0 24 24"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth="2"
              d="M4 6h16M4 12h16M4 18h16"
            ></path>
          </svg>
        </button>
      </div>

      {/* Navigation Links for Desktop */}
      <nav className="hidden md:flex space-x-8">
        <ul className="flex space-x-8">
          <li className="cursor-pointer">Home</li>
          <li className="cursor-pointer">About Us</li>
          <li className="cursor-pointer">Contact Us</li>
          <li>
            <button className="bg-orange-600 text-white px-4 py-2 rounded hover:bg-orange-700 transition duration-300">
              Download App
            </button>
          </li>
        </ul>
      </nav>

      {/* Mobile Menu (only visible when toggled open) */}
      {isOpen && (
        <nav className="absolute top-20 left-0 w-full bg-white shadow-lg md:hidden z-50">
          <ul className="flex flex-col items-center space-y-4 py-4">
            <li className="cursor-pointer">Home</li>
            <li className="cursor-pointer">About Us</li>
            <li className="cursor-pointer">Contact Us</li>
            <li>
              <button className="bg-orange-600 text-white px-4 py-2 rounded hover:bg-orange-700 transition duration-300">
                Download App
              </button>
            </li>
          </ul>
        </nav>
      )}
    </div>
  );
};

export default Navbar;
